import React, { useState } from "react";
import "./App.css";

function App() {
  const defaultPeople = [
    {
      firstName: "John",
      lastName: "Lewis",
    },
    {
      firstName: "Tom",
      lastName: "Hanks",
    },
    {
      firstName: "Melissa",
      lastName: "Rauch",
    },
    {
      firstName: "Laura",
      lastName: "Spencer",
    },
  ];

  const [people, setPeople] = useState(defaultPeople);
  return (
    <div className="App">
      {people.map((person) => (
        <div>
          <ol>
            <li>
              {person.firstName} ''
              {person.lastName}
            </li>
          </ol>
        </div>
      ))}
    </div>
  );
}

export default App;
